import styled from "@emotion/styled"

function EmotionComponent() {
  return (
    <Wrap>
      <Title>test</Title>
      <p>이모션을 활용한 테스트</p>
      <Title>test1</Title>
    </Wrap>
  );
}

const Wrap = styled.div`
  margin: 0 auto;

  & p{
    background-color: aqua;
  }

  &:hover{
    background-color: red;
  }
`;




const Title = styled.h1`
border: 1px solid black;
width: 100%;
`

export default EmotionComponent;
